    const [data,setData]=useState([])

     fetch("./data.json")
     .then (response => response.json())
     .then (data => {
         console.log(data)
         setData(data.card)
     })

    const cards = data.map(item => {
        return (
            <Card 

                title={item.title}
                about={item.about}
            />
        )
    })  

    console.log(data)


    return (
        <div className="wrapper">
           <h3 className="wrapper-text">Connect people and spaces</h3> 
          {cards}
        </div>
    )
}
